import React from 'react';
import styled from 'styled-components';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import StoryEle from './storyEle';

const StoryDiv=styled.div`
  border-radius:3px;
  border:solid 1px #dbdbdb;
  padding:16px 0;
  width:700px;
  height:122px;
  margin: 0 auto;
`
function Story() {
  const setting={
    dots:false,
    slidesToShow:8,
    slidesToScroll:5,
    speed:500,
    arrow:true,
    infinite:false
  }
  return (
    <StoryDiv>
      <Slider {...setting} className="SliderDiv">
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/test.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/test.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/test.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/test.png' name='growing_beomeo'/>
        <StoryEle img='images/activeStatus/photo.png' name='growing_beomeo'/>
      </Slider>
    </StoryDiv>
  );
}

export default Story;
